/* 
 流动箭头效果,参考 MaterialProperty
 */

(function() {
	let defaultImage = "data:image/png;base64,";
	
	let FlowArrowMaterialProperty = function(color, duration) {
		this._definitionChanged = new Cesium.Event();
		this._color = color;
		this._colorSubscription = undefined;
		this.color = color;
		this.image = defaultImage;
		this.duration = duration;
		this._time = (new Date()).getTime();
	}

	Object.defineProperties(FlowArrowMaterialProperty.prototype, {
		isConstant: {
			get: function() {
				return false;
			}
		},
		definitionChanged: {
			get: function() {
				return this._definitionChanged;
			}
		},
		color: Cesium.createPropertyDescriptor('color')
	});

	FlowArrowMaterialProperty.prototype.getType = function(time) {
		return 'FlowArrow';
	};

	FlowArrowMaterialProperty.prototype.getValue = function(time, result) {
		if (!Cesium.defined(result)) {
			result = {};
		}
		result.color = Cesium.Property.getValueOrClonedDefault(this._color, time, Cesium.Color.WHITE, result.color);
		result.image = this.image;
		result.time = (((new Date()).getTime() - this._time) % this.duration) / this.duration;
		return result;
	};

	FlowArrowMaterialProperty.prototype.equals = function(other) {
		return this === other ||
			(other instanceof FlowArrowMaterialProperty &&
				Property.equals(this._color, other._color))
	};

	Cesium.FlowArrowMaterialProperty = FlowArrowMaterialProperty;

	let source = "czm_material czm_getMaterial(czm_materialInput materialInput){" +
			"czm_material material = czm_getDefaultMaterial(materialInput);\n" +
			"vec2 st = materialInput.st;\n" +
			"vec4 colorImage = texture2D(image, vec2(fract(st.s - time), st.t));\n" +
			"material.alpha = colorImage.a * color.a;\n" +
			// "material.diffuse = (colorImage.rgb + color.rgb) / 2.0;\n" +
			"material.diffuse = color.rgb;\n" +
			"return material;\n" +
		"}";

	Cesium.Material._materialCache.addMaterial('FlowArrow', {
		fabric: {
			type: "FlowArrow",
			// uniforms向着色器和czm_getMaterial函数传值
			uniforms: {
				color: new Cesium.Color(1.0, 0.0, 0.0, 1.0),
				// image: 'image/ArrowOpacity.png',
				image: defaultImage,
				time: 0
			},
			source: source
		},
		translucent: function(material) {
			return true;
		}
	});

})()


